import React from 'react';

const OrderTable = () => {
    return (
        <div>
            <div>
                <div>
                    <span>Количество</span>
                </div>
                <div>
                    <span>Норер цвета</span>
                </div>
            </div>

            <div>
                <div>
                    <span>2</span>
                </div>

                <div>
                    <span>1234</span>
                </div>
            </div>
        </div>
    );
};

export default OrderTable;
